he painting depicts a young woman with hazel eyes and a smattering of freckles on her nose and cheeks. ',999.00,'80x120','2024-02-02 12:16:01.221000','2024-02-02 12:16:02.389000','2024-02-02 12:16:02.386000',1,1);
